import SketchLogo from "../../media/icons/methodology/Sketch.svg";
import EightGridLogo from "../../media/icons/methodology/8pt.svg"
import AtomicDesignLogo from "../../media/icons/methodology/atomicdesign.svg";
import RawSketchLogo from "../../media/icons/methodology/rawSketch.svg";
import InvisionLogo from "../../media/icons/methodology/invision.svg";
import StyledComponentsLogo from "../../media/icons/methodology/styledcomponents.png";
import Html5Logo from "../../media/icons/methodology/Html5.svg";
import ReactLogo from "../../media/icons/methodology/React.svg";
import ZeplinLogo from "../../media/icons/methodology/zeplin.svg";
import {colorsRoles} from "./Colors";


export const Sketch = {
    title: "Sketch",
    altImage: "Sketch logo",
    logo: SketchLogo,
    color: colorsRoles.Sketch,
}

export const EightPoint = {
    title: "8 point design",
    altImage: "8 point design",
    logo: EightGridLogo,
    color: colorsRoles.Sketch,
}
export const AtomicDesign = {
    title: "Atomic design",
    altImage: "Atomic design logo",
    logo: AtomicDesignLogo,
    color: colorsRoles.Sketch,
}

export const RawSketch = {
    title: "Raw sketch",
    altImage: "Raw sketch logo",
    logo: RawSketchLogo,
    color: colorsRoles.Sketch,
}

export const Invision = {
    title: "Invision",
    altImage: "Invision logo",
    logo: InvisionLogo,
    color: colorsRoles.Sketch,
}

export const StyledComponents = {
    title: "Styled components",
    altImage: "Styled components logo",
    logo: StyledComponentsLogo,
    color: colorsRoles.Sketch,
}

export const Html5 = {
    title: "Html 5",
    altImage: "Html 5 logo",
    logo: Html5Logo,
    color: colorsRoles.Sketch,
}

export const ReactJs = {
    title: "React",
    altImage: "React logo",
    logo: ReactLogo,
    color: colorsRoles.Sketch,
}
export const Zeplin = {
    title: "Zeplin",
    altImage: "Zeplin logo",
    logo: ZeplinLogo,
    color: colorsRoles.Sketch,
}
